  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { PropsTable, Playground } from 'docz';
import Navigation from './Navigation.tsx';

export default ({components, ...props}) => <MDXTag name="wrapper"  components={components}>
<MDXTag name="h1" components={components} props={{"id":"navigation"}}>{`Navigation`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"basic-usage"}}>{`Basic Usage`}</MDXTag>
<Playground __position={0} __code={`() => {
  const NavigationLinks = [
    {
      name: \'Home\',
      url: \'/src-components-navigation-docx\',
    },
    {
      name: \'Chat Room\',
      url: \'/src-components-navigation-docx\',
    },
  ]

  return <Navigation items={NavigationLinks} />
}`} __scope={{props,Navigation}} >
  {() => {
    const NavigationLinks = [
      {
        name: "Home",
        url: "/src-components-navigation-docx"
      },
      {
        name: "Chat Room",
        url: "/src-components-navigation-docx"
      }
    ];

    return <Navigation items={NavigationLinks} />
  }}
</Playground>
<MDXTag name="hr" components={components}></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"properties"}}>{`Properties`}</MDXTag>
<PropsTable of={Navigation} /></MDXTag>
